import React from 'react';
import Card from './Card';
const CardList = ({cats}) =>
{
    const cardsArray = cats.map((user,i) =>{
    return <Card id={cats[i].id} name={cats[i].name} email={cats[i].email}/>
    })
    return(
    <div>
        {cardsArray};
    </div>
    );
}

export default CardList;
